import React from "react";
import "./FoodAndWine.css";
import { Tabs, Tab, Row, Col } from "react-bootstrap";
import { ImSpoonKnife } from "react-icons/im";
import { useState } from "react";

const FoodAndWine = () => {
  const [key, setKey] = useState("home");

  return (
    <div>
      
      <div className="title">
        <div class="container py-4">
          <header class="pb-3 mb-4 border-bottom">
            <a class="d-flex align-items-center text-dark text-decoration-none">
              <span class="fs-4">
                <BsFillChatDotsFill className="initial-icons" />
                &nbsp; Blog
              </span>
            </a>
          </header>{" "}
        </div>

        <Tabs
         
          activeKey={key}
          onSelect={(k) => setKey(k)}
          transition={false}
          className="mb-6"
        >
          <Tab eventKey="home" title="Big Categories">
            <div className="tab-body">Tab1</div>
          </Tab>
          <Tab eventKey="profile" title="Day Type">
            <div className="tab-body">Tab2</div>
          </Tab>
          <Tab eventKey="contact" title="Specific Foods">
            <div className="tab-body" >Tab3</div>
          </Tab>
        </Tabs>
      </div>
    </div>
  );
};

export default FoodAndWine;
